import React from "react";
import { Link} from "react-router-dom";

const Navbar = () => {
    return (
        <nav className="navbar navbar-dark bg-dark mb-4">
            <span className="navbar-brand mb-3 mx-auto">
                <Link to={`/`} className="bg-light"><h1><strong>E-Commerce</strong></h1></Link>
                <Link to={`/add-item`} className="btn btn-light float-left">
                    Create item
                </Link>
                <Link to={`/cart`} className="btn btn-light float-right">
                    <i className="fas fa-shopping-cart"></i>
                </Link>
            </span>
        </nav>
    );
};

export default Navbar;
